import React, { Component } from 'react'
import {InfoConsumer} from '../Context';
import Info from '../Info'

function Home(){
    return (
        <div className="container">
            <div className="row mt-5">
            <InfoConsumer>
            {
                data => {
                    return <Info item={data}/>;
                }
            }
        </InfoConsumer>
            </div>
        </div>
        );
}
export default Home;
